<div class="entities" style="line-height: 2.5; direction: ltr">ABT - 737 is highly effective against molecular subgroups of multiple myeloma . Multiple myeloma is a plasma cell malignancy that is heterogeneous with respect to its causative molecular abnormalities and the treatment response of patients . The Bcl - 2 protein family is critical for myeloma cell survival . ABT - 737 is a cell-permeant compound that binds to Bcl - 2 and Bcl-x ( L ) but not to Mcl - 1 . Using a myeloma cell line collection ( n = 25 ) representative of different molecular translocations , we showed that ABT - 737 effectively kills a subset of cell lines ( n = 6 ) , with a median lethal dose ranging from 7 ± 0.4 nM to 150 ± 7.5 nM . Of interest , all sensitive cell lines harbored a t ( 11 ; 14 ) . We demonstrated that ABT - 737 - sensitive and ABT - 737 - resistant cell lines could be differentiated by the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 /

 expression ratio . A screen of a public expression database of myeloma patients indicates that the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , an orally active counterpart to ABT - 737 , for the treatment of t ( 11 ; 14 ) and hyperdiploid groups of myeloma harboring a Bcl - 2 ( high ) / Mcl - 1 ( low ) profile .</div>

 expression levels correlated positively with invasion capacity , which could be significantly inhibited by

 activity in human and rat glioma : characterization and mechanism of resistance to antitopoisomerase chemical , camptothecin - 11 ] .

 ) respectively exhibit a 5.4- and 7.3- fold increase in resistance to CPT - 11 . No differences in topo I activity and intracellular accumulation of CPT - 11 were observed between parent and CPT - 11 resistant lines . On the other hand , topo I from T98G / CPT - 11 and

<h2 style="margin: 0">16</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">The human gonadotropin releasing hormone type I receptor is a functional intracellular GPCR expressed on the nuclear membrane . The mammalian type I gonadotropin releasing hormone receptor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) is a structurally unique G protein-coupled receptor ( GPCR ) that lacks cytoplasmic tail sequences and displays inefficient plasma membrane expression ( PME ) . Compared to its murine counterparts , the primate type I receptor is inefficiently folded and retained in the endoplasmic reticulum ( ER ) leading to a further reduction in PME . The decrease in PME and concomitant increase in intracellular localization of the mammalian DB00644 - RI led us to characterize the spatial distribution of the human and mouse DB00644 receptors in two human cell lines , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29320

</mark>
 293 and HTR - 8/ SVneo . In both human cell lines we found the receptors were expressed in the cytoplasm and were associated with the ER and nuclear membrane . A molecular analysis of the receptor protein sequence led us to identify a putative monopartite nuclear localization sequence ( NLS ) in the first intracellular loop of DB00644 - RI . Surprisingly , however , neither the deletion of the NLS nor the addition of the Xenopus 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P30968

</mark>
 cytoplasmic tail sequences to the human receptor altered its spatial distribution . Finally , we demonstrate that DB00644 treatment of nuclei isolated from 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29320
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 293 cells expressing exogenous DB00644 - RI triggers a significant increase in the acetylation and phosphorylation of histone H3 , thereby revealing that the nuclear-localized receptor is functional . Based on our findings , we conclude that the mammalian DB00644 - RI is an intracellular GPCR that is expressed on the nuclear membrane . This major and novel discovery causes us to reassess the signaling potential of this physiologically and clinically important receptor .</div>

<h2 style="margin: 0">18</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Novel camptothecin analogues that circumvent Q9UNQ0 - associated drug resistance in human tumor cells . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00762
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 ( 7 - ethyl - 10 - [ 4 - ( 1 - piperidino ) - 1 - piperidino ] - carbonyloxycamptothecin ; CPT - 11 ) is a widely used potent antitumor drug that inhibits mammalian 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P11387
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( Topo I ) ; however , overexpression of Q9UNQ0 ( Q9UNQ0 / Q9UNQ0 / Q9UNQ0 ) can confer cancer cell resistance to SN - 38 , the active form of CPT - 11 . We have recently demonstrated that plasma membrane vesicles prepared from Q9UNQ0 - overexpressing PC - 6 / Q8WUX1 - 5H cells transported SN - 38 and its glucuronide conjugate in an DB00171 - dependent manner ( Nakatomi et al . , Biochem Biophys Res Commun 2001 ; 288:827- 32 ) . In the present study , we have characterized a total of 14 new camptothecin ( CPT ) analogues with respect to both the inhibition of Topo I and the substrate specificity of Q9UNQ0 . All of the tested CPT analogues , which have different substitutions at positions 10 and 11 , strongly inhibited the Topo I activity in a cell-free system , as did SN - 38 . Their antitumor activities in the SN - 38 - resistant PC - 6 / Q8WUX1 - 5H2 cell line greatly varied , however , being correlated with intracellular accumulation levels . We have examined DB00171 - dependent transport of those CPT analogues by using plasma membrane vesicles prepared from both PC - 6 / Q8WUX1 - 5H2 cells and Q9UNQ0 - transfected 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29320
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - 293 cells . Based on the substrate specificity of Q9UNQ0 thus evaluated , it is strongly suggested that CPT analogues with high polarity are good substrates for Q9UNQ0 and are therefore effectively extruded from cancer cells . In this context , to circumvent Q9UNQ0 - associated drug resistance , low-polarity CPT analogues are considered to be potent lead compounds . The present study provides a practical approach to discover new CPT-based drugs for the chemotherapy of drug-resistant human cancer .</div>
